  }*/

  const artwalk = props.getArtwalk(props.id);
  let content = <p>Loading</p>;
  if (artwalk) {
    content =
      <>
        <h1>{artwalk.name}</h1>

        <h3>Bilds</h3>
        <ul>
          {artwalk.bilds.map((k, index) => <li key={index}>{k}</li>)}
        </ul>


        {/* TODO: Add DELETE artwalk button! */}
        <br />
        <Link to="/">Back</Link>
      </>
  }

  return content;
}

export default Artwalk;
